    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Agassiz NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Agassiz NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, information about the Refuge environment
    and management, and strategies for plan implementation. Key planning issues include:
    habitat management, water management, wildlife management, and wildlife-dependent
    recreation.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
